import { getUnpackedSettings } from 'http2'
import React from 'react'

interface IProps {
	guests: {
		name: string 
		age: number 
		url: string 
		note?: string
	}[]
}


const List: React.FC<IProps> = ({ guests }) =>  {
	return (
		<ul>
			{guests.map(guest => {
				return (
					<div>{guest.name}</div>
				)
			}) }	
		</ul>
	)
}

export default List;
